description:
In his third adventure, archeologist Diamon Jones has settled into a simple, peaceful life until one unforgettable day when a suspicious man appears in Jones' restaurant. The visitor is pursued by a strange man dressed as Elvis Presley and a two-headed Cerberus dog! That's just the beginning of yet another incredible adventure that sees Jones search for ancient treasures, journey to Hell, and contract with the Devil for a chance to become a Hollywood star. Will he be able to overcome these difficult challenges?
